        "field": "serviceName.keyword",
        "customLabel": "Service Name"
      }
    },
    {
      "id": "3",
      "enabled": true,
      "type": "terms",
      "schema": "segment",
      "params": {
        "field": "owner.keyword",
        "otherBucket": false,
        "otherBucketLabel": "Other",
        "missingBucket": false,
        "missingBucketLabel": "Missing",
        "size": 10,
        "order": "desc",
        "orderBy": "1",
        "customLabel": "Owner"
      }
    },
    {
      "id": "2",
      "enabled": true,
      "type": "terms",
      "schema": "segment",
      "params": {
        "field": "org.springframework.boot:spring-boot.keyword",
        "otherBucket": false,
        "otherBucketLabel": "Other",
        "missingBucket": false,
        "missingBucketLabel": "Missing",
        "size": 20,
        "order": "desc",
        "orderBy": "1",
        "customLabel": "Spring Boot Version"
      }
    }
  ]
}

{
  "title": "Spring Boot Usage Table",
  "type": "table",
  "params": {
    "perPage": 10,
    "showPartialRows": false,
    "sort": {
      "columnIndex": null,
      "direction": null
    },
    "showTotal": false,
    "totalFunc": "sum",
    "showMetricsAtAllLevels": false
  },
  "aggs": [
    {
      "id": "1",
      "enabled": true,
      "type": "top_hits",
      "schema": "metric",
      "params": {
        "field": "org.springframework.boot:spring-boot",
        "aggregate": "concat",
        "size": 1,
        "sortField": "_id",
        "sortOrder": "asc",
        "customLabel": "Version"
      }
    },
    {
      "id": "4",
      "enabled": true,
      "type": "filters",
      "schema": "split",
      "params": {
        "filters": [
          {
            "input": {
              "query": {
                "wildcard": {
                  "org.springframework.boot:spring-boot": "2.*"
                }
              },
              "language": "lucene"
            },
            "label": "Spring Boot 2"
          },
          {
            "input": {
              "query": {
                "wildcard": {
                  "org.springframework.boot:spring-boot": "1.5.*"
                }
              },
              "language": "lucene"
            },
            "label": "Spring Boot 1.5"
          },
          {
            "input": {
              "query": {
                "bool": {
                  "must": {
                    "wildcard": {
                      "org.springframework.boot:spring-boot": "1.*"
                    }
                  },
                  "must_not": {
                    "wildcard": {
                      "org.springframework.boot:spring-boot": "1.5.*"
                    }
                  }
                }
              },
              "language": "lucene"
            },
            "label": "Spring Boot 1.x (other)"
          }
        ],
        "row": false
      }
    },
    {
      "id": "3",
      "enabled": true,
      "type": "terms",
      "schema": "bucket",
      "params": {
        "field": "serviceName.keyword",
        "otherBucket": false,
        "otherBucketLabel": "Other",
        "missingBucket": false,
        "missingBucketLabel": "Missing",
        "size": 80,
        "order": "asc",
        "orderBy": "_key",
        "customLabel": "Service Name"
      }
    }
  ]
}

